INSERT INTO `course` VALUES (20,'Professional Real Estate Certificate for Beginners','Professional Real Estate Certificate for Beginners','','','','2015-02-22 08:17:00','<p><strong>Course Name</strong>:&nbsp;Professional Real Estate Certificate for Beginners</p>\n\n<p><strong>Date</strong>:7-8-9 March 2015</p>\n\n<p><strong>Duration</strong>:&nbsp;3 Days, 12 Credit Hours</p>\n\n<p>Saturday:&nbsp;9:00 AM - 1:00PM<br />\nSunday&nbsp;and&nbsp;Monday:&nbsp;5:30&nbsp;PM - 9:30&nbsp;PM</p>\n\n<p><strong>Course Objectives</strong>:&nbsp;This&nbsp;certificate is designed to help you become productive and successful as quickly as possible in your career in&nbsp;Real&nbsp;Estate.&nbsp;How to make your business (Prospecting Tools and&nbsp;Methods), define what is&nbsp;the buyer and seller services.</p>\n\n<p><strong>Modules Outlines</strong>:</p>\n\n<p>Day&nbsp;1:&nbsp;(Prospecting Tools and&nbsp;Methods)</p>\n\n<ul>\n	<li>Identify proven tools to enhance your prospects.</li>\n	<li>Explain how to use tried and true prospecting methods to win customers.</li>\n	<li>Explain how to apply the &ldquo;Cycle of Success.&rdquo;</li>\n	<li>Describe the importance of prospecting continuously to achieve business goals.</li>\n	<li>Explain how to identify and develop your &ldquo;Sphere of Influence.&rdquo;</li>\n	<li>Identify the information you need to collect from your prospects.&nbsp;</li>\n</ul>\n\n<p>Day&nbsp;2:&nbsp;( Working With Clients,&nbsp;Buyers&nbsp;and&nbsp;Sellers)</p>\n\n<ul>\n	<li>Explain the importance of consulting with buyers and sellers.</li>\n	<li>Use the Cycle of Success to plan and evaluate a meeting with a buyer.</li>\n	<li>Describe the process for selecting properties that meet buyers&#39; needs.</li>\n	<li>Describe techniques for showing properties.</li>\n	<li>Identify buying signals during demonstrations.</li>\n	<li>Describe how to obtain the buyers&#39; agreement to make an offer.</li>\n	<li>Describe how the Cycle of Success helps you plan for a listing presentation.</li>\n	<li>Describe ways to build rapport with sellers and gain their trust.</li>\n	<li>Describe how to evaluate sellers&#39; motivations and the quality of a listing.</li>\n	<li>Describe the activities necessary to develop a listing presentation.</li>\n	<li>Describe the three main closes you&#39;ll make with sellers during a listing presentation and how to handle objections concerning each.&nbsp;</li>\n</ul>\n\n<p>Day&nbsp;3:&nbsp;(Obtaining&nbsp;and&nbsp;Planning Customers Meeting)</p>\n\n<ul>\n	<li>Explain the importance of consulting with buyers and sellers.</li>\n	<li>Relate the cycle of success to obtaining appointment with buyers and sellers</li>\n	<li>Recognize the opportunity of email leadsand describe how followup on email inquiry</li>\n	<li>Use the Cycle of Success to plan and evaluate a meeting with a buyer.</li>\n	<li>Describe the tools of the buyer service system</li>\n	<li>How can you be sure that your clients are getting what they really want?</li>\n</ul>\n\n<p>&nbsp;* This course will be repeated in following date: 1-2-3 April, 2-3-4 May 2015</p>\n','<p>&nbsp;</p>\n\n<p><strong>Course Name</strong>:&nbsp;Professional Real Estate Certificate for Beginners</p>\n\n<p><strong>Date</strong>:7-8-9 March 2015</p>\n\n<p><strong>Duration</strong>:&nbsp;3 Days, 12 Credit Hours</p>\n\n<p>Saturday:&nbsp;9:00 AM - 1:00PM<br />\nSunday&nbsp;and&nbsp;Monday:&nbsp;5:30&nbsp;PM - 9:30&nbsp;PM</p>\n\n<p><strong>Course Objectives</strong>:&nbsp;This&nbsp;certificate is designed to help you become productive and successful as quickly as possible in your career in&nbsp;Real&nbsp;Estate.&nbsp;How to make your business (Prospecting Tools and&nbsp;Methods), define what is&nbsp;the buyer and seller services.</p>\n\n<p><strong>Modules Outlines</strong>:</p>\n\n<p>Day&nbsp;1:&nbsp;(Prospecting Tools and&nbsp;Methods)</p>\n\n<ul>\n	<li>Identify proven tools to enhance your prospects.</li>\n	<li>Explain how to use tried and true prospecting methods to win customers.</li>\n	<li>Explain how to apply the &ldquo;Cycle of Success.&rdquo;</li>\n	<li>Describe the importance of prospecting continuously to achieve business goals.</li>\n	<li>Explain how to identify and develop your &ldquo;Sphere of Influence.&rdquo;</li>\n	<li>Identify the information you need to collect from your prospects.&nbsp;</li>\n</ul>\n\n<p>Day&nbsp;2:&nbsp;( Working With Clients,&nbsp;Buyers&nbsp;and&nbsp;Sellers)</p>\n\n<ul>\n	<li>Explain the importance of consulting with buyers and sellers.</li>\n	<li>Use the Cycle of Success to plan and evaluate a meeting with a buyer.</li>\n	<li>Describe the process for selecting properties that meet buyers&#39; needs.</li>\n	<li>Describe techniques for showing properties.</li>\n	<li>Identify buying signals during demonstrations.</li>\n	<li>Describe how to obtain the buyers&#39; agreement to make an offer.</li>\n	<li>Describe how the Cycle of Success helps you plan for a listing presentation.</li>\n	<li>Describe ways to build rapport with sellers and gain their trust.</li>\n	<li>Describe how to evaluate sellers&#39; motivations and the quality of a listing.</li>\n	<li>Describe the activities necessary to develop a listing presentation.</li>\n	<li>Describe the three main closes you&#39;ll make with sellers during a listing presentation and how to handle objections concerning each.&nbsp;</li>\n</ul>\n\n<p>Day&nbsp;3:&nbsp;(Obtaining&nbsp;and&nbsp;Planning Customers Meeting)</p>\n\n<ul>\n	<li>Explain the importance of consulting with buyers and sellers.</li>\n	<li>Relate the cycle of success to obtaining appointment with buyers and sellers</li>\n	<li>Recognize the opportunity of email leadsand describe how followup on email inquiry</li>\n	<li>Use the Cycle of Success to plan and evaluate a meeting with a buyer.</li>\n	<li>Describe the tools of the buyer service system</li>\n	<li>How can you be sure that your clients are getting what they really want?</li>\n</ul>\n\n<p>&nbsp;* This course will be repeated in following date: 1-2-3 April, 2-3-4 May 2015</p>\n'),(21,'Advanced Professional Real Estate Certificate','Advanced Professional Real Estate Certificate','','','','2015-02-22 08:18:29','<p><strong>Course Name</strong>:&nbsp;Advanced Professional Real Estate Certificate</p>\n\n<p><strong>Date</strong>:&nbsp;14-15-16 March 2015</p>\n\n<p><strong>Duration</strong>:&nbsp;3 Days, 12 Credit Hours</p>\n\n<p>Saturday&nbsp;from:&nbsp;9:00 AM - 1:00PM<br />\nSunday&nbsp;and&nbsp;Monday&nbsp;from&nbsp;5:00 PM - 9:00 PM</p>\n\n<p><strong>Course Objectives</strong>:&nbsp;This certificate is designed for people who&nbsp;have&nbsp;already&nbsp;pursued&nbsp;the Real&nbsp;Estate&nbsp;career and are looking to learn the&nbsp;ultimate dealing with&nbsp;clients&nbsp;and improving thier&nbsp;Negotiation skills&nbsp;to get the best offer&nbsp;which aims to ha a&nbsp;win-win&nbsp;deal.</p>\n\n<p><strong>Moduals&nbsp;Outlines</strong>:</p>\n\n<p>Day&nbsp;1:&nbsp;(Showing properties&nbsp;and&nbsp;Closing&nbsp;deals)</p>\n\n<ul>\n	<li>Describe the process for selecting properties that meet buyers needs</li>\n	<li>Describe how to refine your understanding of buyer&#39;s need during property&nbsp;showing</li>\n	<li>Describe techniques for demonstrating properties</li>\n	<li>Identify buying&nbsp;sings&nbsp;during&nbsp;property showing</li>\n	<li>Describe how to obtain the buyer&#39;s agreement to&nbsp;finalize&nbsp;an offer</li>\n</ul>\n\n<p>Day&nbsp;2:&nbsp;( Real Estate Negotiation Strategies to&nbsp;finalize a&nbsp;deal)</p>\n\n<ul>\n	<li>Distinguish between bargaining, influencing and negotiating</li>\n	<li>Identify and explain the key stages in negotiations</li>\n	<li>Identify value added in negotiations</li>\n	<li>Practise the skills necessary for good negotiation</li>\n	<li>Establish reports</li>\n</ul>\n\n<p>Day&nbsp;3:&nbsp;(Real Estate Closing Deals)</p>\n\n<ul>\n	<li>Identify what&rsquo;s the meaning of closing</li>\n	<li>Know how to close using KASH technique&nbsp;</li>\n	<li>Understand why &ldquo;Closing&rdquo; seems so hard</li>\n	<li>How to handle objections</li>\n	<li>Learn different types of closing</li>\n	<li>Converting features to benefits in the selling process</li>\n</ul>\n\n<p>&nbsp;* This course will be repeated in following date: 9-19-11 May 2015</p>\n','<p><strong>Course Name</strong>:&nbsp;Advanced Professional Real Estate Certificate</p>\n\n<p><strong>Date</strong>:&nbsp;14-15-16 March 2015</p>\n\n<p><strong>Duration</strong>:&nbsp;3 Days, 12 Credit Hours</p>\n\n<p>Saturday&nbsp;from:&nbsp;9:00 AM - 1:00PM<br />\nSunday&nbsp;and&nbsp;Monday&nbsp;from&nbsp;5:00 PM - 9:00 PM</p>\n\n<p><strong>Course Objectives</strong>:&nbsp;This certificate is designed for people who&nbsp;have&nbsp;already&nbsp;pursued&nbsp;the Real&nbsp;Estate&nbsp;career and are looking to learn the&nbsp;ultimate dealing with&nbsp;clients&nbsp;and improving thier&nbsp;Negotiation skills&nbsp;to get the best offer&nbsp;which aims to ha a&nbsp;win-win&nbsp;deal.</p>\n\n<p><strong>Moduals&nbsp;Outlines</strong>:</p>\n\n<p>Day&nbsp;1:&nbsp;(Showing properties&nbsp;and&nbsp;Closing&nbsp;deals)</p>\n\n<ul>\n	<li>Describe the process for selecting properties that meet buyers needs</li>\n	<li>Describe how to refine your understanding of buyer&#39;s need during property&nbsp;showing</li>\n	<li>Describe techniques for demonstrating properties</li>\n	<li>Identify buying&nbsp;sings&nbsp;during&nbsp;property showing</li>\n	<li>Describe how to obtain the buyer&#39;s agreement to&nbsp;finalize&nbsp;an offer</li>\n</ul>\n\n<p>Day&nbsp;2:&nbsp;( Real Estate Negotiation Strategies to&nbsp;finalize a&nbsp;deal)</p>\n\n<ul>\n	<li>Distinguish between bargaining, influencing and negotiating</li>\n	<li>Identify and explain the key stages in negotiations</li>\n	<li>Identify value added in negotiations</li>\n	<li>Practise the skills necessary for good negotiation</li>\n	<li>Establish reports</li>\n</ul>\n\n<p>Day&nbsp;3:&nbsp;(Real Estate Closing Deals)</p>\n\n<ul>\n	<li>Identify what&rsquo;s the meaning of closing</li>\n	<li>Know how to close using KASH technique&nbsp;</li>\n	<li>Understand why &ldquo;Closing&rdquo; seems so hard</li>\n	<li>How to handle objections</li>\n	<li>Learn different types of closing</li>\n	<li>Converting features to benefits in the selling process</li>\n</ul>\n\n<p>&nbsp;* This course will be repeated in following date: 9-19-11 May 2015</p>\n'),(22,'Financial Analysis for Commercial Real Estate Investment','Financial Analysis for Commercial Real Estate Investment','','','','2015-02-22 08:19:49','<p><strong>Course Name</strong>:&nbsp;Financial Analysis for Commercial Real Estate Investment</p>\n\n<p><strong>Date</strong>:&nbsp;27-28-29 March 2015</p>\n\n<p><strong>Duration</strong>:&nbsp;3 Days, 12 Credit Hours</p>\n\n<p>Friday&nbsp;:&nbsp;9:00 AM - 1:00PM<br />\nSaturday&nbsp;Sunday&nbsp;5:30&nbsp;PM - 9:30&nbsp;PM</p>\n\n<p><strong>Course Objectives</strong>:&nbsp;This Certificate is designed to develop your knowledge in both fundamental principles and contemporary techniques of the financing process ,boost your earnings,&nbsp;confidenceand&nbsp;provide you with a well rounded education in Commercial Investment of Real Estate</p>\n\n<p><strong>Modules Outlines</strong>:</p>\n\n<p>Day&nbsp;1:&nbsp;(Investment Fundamentals)</p>\n\n<ul>\n	<li>Define investment&nbsp;and name three investor types</li>\n	<li>Distinguish between loan- and equity-type investments</li>\n	<li>Identify investment characteristics such as liquidity and marketability</li>\n	<li>Identify accepted strategies for quantifying and managing risk</li>\n	<li>Categorize&nbsp;Real&nbsp;Estate investment properties according to property type</li>\n	<li>Identify T-bar components and how T-bars are used to compare investments</li>\n	<li>State general investor preferences regarding optimal returns on investment</li>\n	<li>Cash Flow Model</li>\n</ul>\n\n<p>Day&nbsp;2:&nbsp;(Cash Flow Model)</p>\n\n<ul>\n	<li>Identify the components of the Cash Flow Model and where NOI fits into the model</li>\n	<li>Define and identify the components of NOI</li>\n	<li>Identify source data used to calculate NOI</li>\n	<li>Calculate NOI using the Annual Property Operating Data (APOD) worksheet and case data provided</li>\n</ul>\n\n<p>Day&nbsp;3:&nbsp;(Time Value of Money)</p>\n\n<ul>\n	<li>Explain the economic principle of TVM</li>\n	<li>Define present value (PV) and future value (FV), compounding and discounting</li>\n	<li>Set up and use T-bars to compute PV and FV</li>\n	<li>Identify and solve six types of compounding or discounting calculations (six functions of a dollar)</li>\n	<li>Solve TVM calculations based on real estate investment situations</li>\n	<li>State why TVM calculations are a necessary step in cash flow analysis of investment alternative</li>\n</ul>\n\n<p>&nbsp;* This course will be repeated in following date: 4-5-6 April, 16-17-18 May 2015</p>\n','<p>&nbsp;</p>\n\n<p><strong>Course Name</strong>:&nbsp;Financial Analysis for Commercial Real Estate Investment</p>\n\n<p><strong>Date</strong>:&nbsp;27-28-29 March 2015</p>\n\n<p><strong>Duration</strong>:&nbsp;3 Days, 12 Credit Hours</p>\n\n<p>Friday&nbsp;:&nbsp;9:00 AM - 1:00PM<br />\nSaturday&nbsp;Sunday&nbsp;5:30&nbsp;PM - 9:30&nbsp;PM</p>\n\n<p><strong>Course Objectives</strong>:&nbsp;This Certificate is designed to develop your knowledge in both fundamental principles and contemporary techniques of the financing process ,boost your earnings,&nbsp;confidenceand&nbsp;provide you with a well rounded education in Commercial Investment of Real Estate</p>\n\n<p><strong>Modules Outlines</strong>:</p>\n\n<p>Day&nbsp;1:&nbsp;(Investment Fundamentals)</p>\n\n<ul>\n	<li>Define investment&nbsp;and name three investor types</li>\n	<li>Distinguish between loan- and equity-type investments</li>\n	<li>Identify investment characteristics such as liquidity and marketability</li>\n	<li>Identify accepted strategies for quantifying and managing risk</li>\n	<li>Categorize&nbsp;Real&nbsp;Estate investment properties according to property type</li>\n	<li>Identify T-bar components and how T-bars are used to compare investments</li>\n	<li>State general investor preferences regarding optimal returns on investment</li>\n	<li>Cash Flow Model</li>\n</ul>\n\n<p>Day&nbsp;2:&nbsp;(Cash Flow Model)</p>\n\n<ul>\n	<li>Identify the components of the Cash Flow Model and where NOI fits into the model</li>\n	<li>Define and identify the components of NOI</li>\n	<li>Identify source data used to calculate NOI</li>\n	<li>Calculate NOI using the Annual Property Operating Data (APOD) worksheet and case data provided</li>\n</ul>\n\n<p>Day&nbsp;3:&nbsp;(Time Value of Money)</p>\n\n<ul>\n	<li>Explain the economic principle of TVM</li>\n	<li>Define present value (PV) and future value (FV), compounding and discounting</li>\n	<li>Set up and use T-bars to compute PV and FV</li>\n	<li>Identify and solve six types of compounding or discounting calculations (six functions of a dollar)</li>\n	<li>Solve TVM calculations based on real estate investment situations</li>\n	<li>State why TVM calculations are a necessary step in cash flow analysis of investment alternative</li>\n</ul>\n\n<p>&nbsp;* This course will be repeated in following date: 4-5-6 April, 16-17-18 May 2015</p>\n'),(23,'Doing Business Right','Doing Business Right','','','','2015-02-22 08:23:06','<p><strong>Course Name</strong>:&nbsp;Doing Business Right</p>\n\n<p><strong>Date</strong>:&nbsp;29-30-31 May2015</p>\n\n<p><strong>Duration</strong>:&nbsp;3 Days, 12 Credit Hours</p>\n\n<p>Friday:&nbsp;9:00 AM - 1:00PM<br />\nSaturday&nbsp;and&nbsp;Sunday:&nbsp;5:00 PM - 9:00 PM</p>\n\n<p><strong>Course Objectives</strong>:&nbsp;A fundamental part of every persons role in an organization is bounded by their time management and problem solving skills. So, being a confident problem solver is really important to your success.&nbsp;Much of that confidence comes from having a good process to use.</p>\n\n<p><strong>Modules Outlines</strong>:</p>\n\n<p>Day&nbsp;1:&nbsp;(Sales planning&nbsp;and&nbsp;Goal Setting)</p>\n\n<ul>\n	<li>Use the Success Formula to establish the number of contacts needed to meet your financial goal</li>\n	<li>Create an action plan to assist you in reaching your goal</li>\n	<li>Track your progress to ensure you are staying on target&nbsp;</li>\n	<li>Demonstrate your commitment by scheduling and attending weekly coaching sessions</li>\n	<li>Know the differences between Dreams&nbsp;and Goals&nbsp;</li>\n	<li>Start setting your goals using SMART techniques</li>\n	<li>Motivate yourself&nbsp;</li>\n	<li>The process of planning&nbsp;</li>\n	<li>Understand the agents&nbsp;goal and planning process&nbsp; &nbsp;</li>\n</ul>\n\n<p>Day&nbsp;2:&nbsp;(&nbsp;Time Management)</p>\n\n<ul>\n	<li>What is time management?</li>\n	<li>Assess your current time management skills</li>\n	<li>Set goals:&nbsp; what do you want to do?</li>\n	<li>Create an action plan:&nbsp; how will you do it?</li>\n	<li>Schedule:&nbsp; when will you do it?</li>\n	<li>Organize:&nbsp; tips for success</li>\n</ul>\n\n<p>Day&nbsp;3:&nbsp;(Problem Solving)</p>\n\n<ul>\n	<li>Topic 1: The Problem&nbsp;Solving&nbsp;model.</li>\n	<li>Topic 2: Problem&nbsp;Solving&nbsp;mind&nbsp;traps.</li>\n	<li>Topic 3: Dealing with Problem&nbsp;Solving&nbsp;traps.</li>\n	<li>Topic 4: Problem&nbsp;Solving&nbsp;skills and&nbsp;competencies.</li>\n</ul>\n','<p><strong>Course Name</strong>:&nbsp;Doing Business Right</p>\n\n<p><strong>Date</strong>:&nbsp;29-30-31 May2015</p>\n\n<p><strong>Duration</strong>:&nbsp;3 Days, 12 Credit Hours</p>\n\n<p>Friday:&nbsp;9:00 AM - 1:00PM<br />\nSaturday&nbsp;and&nbsp;Sunday:&nbsp;5:00 PM - 9:00 PM</p>\n\n<p><strong>Course Objectives</strong>:&nbsp;A fundamental part of every persons role in an organization is bounded by their time management and problem solving skills. So, being a confident problem solver is really important to your success.&nbsp;Much of that confidence comes from having a good process to use.</p>\n\n<p><strong>Modules Outlines</strong>:</p>\n\n<p>Day&nbsp;1:&nbsp;(Sales planning&nbsp;and&nbsp;Goal Setting)</p>\n\n<ul>\n	<li>Use the Success Formula to establish the number of contacts needed to meet your financial goal</li>\n	<li>Create an action plan to assist you in reaching your goal</li>\n	<li>Track your progress to ensure you are staying on target&nbsp;</li>\n	<li>Demonstrate your commitment by scheduling and attending weekly coaching sessions</li>\n	<li>Know the differences between Dreams&nbsp;and Goals&nbsp;</li>\n	<li>Start setting your goals using SMART techniques</li>\n	<li>Motivate yourself&nbsp;</li>\n	<li>The process of planning&nbsp;</li>\n	<li>Understand the agents&nbsp;goal and planning process&nbsp; &nbsp;</li>\n</ul>\n\n<p>Day&nbsp;2:&nbsp;(&nbsp;Time Management)</p>\n\n<ul>\n	<li>What is time management?</li>\n	<li>Assess your current time management skills</li>\n	<li>Set goals:&nbsp; what do you want to do?</li>\n	<li>Create an action plan:&nbsp; how will you do it?</li>\n	<li>Schedule:&nbsp; when will you do it?</li>\n	<li>Organize:&nbsp; tips for success</li>\n</ul>\n\n<p>Day&nbsp;3:&nbsp;(Problem Solving)</p>\n\n<ul>\n	<li>Topic 1: The Problem&nbsp;Solving&nbsp;model.</li>\n	<li>Topic 2: Problem&nbsp;Solving&nbsp;mind&nbsp;traps.</li>\n	<li>Topic 3: Dealing with Problem&nbsp;Solving&nbsp;traps.</li>\n	<li>Topic 4: Problem&nbsp;Solving&nbsp;skills and&nbsp;competencies.</li>\n</ul>\n');
